import React, { useEffect,useState } from 'react';
import ListEquipment from './components/List_equipment';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <ListEquipment/>
      <Router basename="/static">
        <Routes>
          <Route exact path="tech" component={ListEquipment} />
        </Routes>
       </Router>   
    </div>
  );
}

export default App;
